INSERT INTO `web_category` VALUES (1,'Aggregates','aggregates',9,NULL,'category/aggregates_1460038602.68.jpg','0,0,400,300','Aggregates can serve many purposes in a design. Functionally, not only do they prevent water runoff and erosion, but they can also prevent weed growth and retain moisture, saving dramatic amounts of water. Visually, when paired with the correct plants or other accent pieces they can provide a dramatic contrast in color and texture, and take your landscape from nice to amazing. \r\n\r\nTake a few minutes and browse through just a small selection of the aggregate products we offer on site at Bedrock Stone & Design.','Aggregates products add visual interest while helping prevent runoff or weed growth on a landscape project.','Aggregates can serve many purposes in a design. Functionally, not only do they prevent water runoff and erosion, but they can also prevent weed growth and retain moisture, saving dramatic amounts of water. Visually, when paired with the correct plants or other accent pieces they can provide a dramatic contrast in color and texture, and take your landscape from nice to amazing. \r\n\r\nTake a few minutes and browse through just a small selection of the aggregate products we offer on site at Bedrock Stone & Design.',NULL,'Aggregates','Agregados','Aggregates products add visual interest while helping prevent runoff or weed growth on a landscape project.','productos agregados añaden interés visual mientras que ayuda a evitar que se escurra o el crecimiento de malas hierbas en un proyecto de paisaje .','aggregates','aggregates'),(2,'Pavers','pavers',11,NULL,'category/pavers_1488393394.08.jpg','0,23,3425,2592','Bedrock Stone carries a full selection of natural stone and manufactured pavers.','Pavers provide the convenience of a uniform size and thickness of a product with the beauty of natural stone.','Bedrock Stone carries a full selection of natural stone and manufactured pavers.',NULL,'Pavers','Pavimentadoras','Pavers provide the convenience of a uniform size and thickness of a product with the beauty of natural stone.','Pavimentadoras ofrecen la comodidad de un tamaño uniforme y el espesor de un producto con la belleza de la piedra natural .','pavers','pavers'),(3,'Patio','patio',3,NULL,'category/patio_1487966506.57.jpg','507,530,3122,2491','Natural stone adds amazing depth and color to a backyard patio. At Bedrock Stone & Design we carry patio stone from Oklahoma, Texas, Mexico and Pennsylvania in many different colors and textures. Whether you\'re building a small walkway or a huge backyard entertaining area, the patio stone we carry will move your project from nice to stunning.\r\n\r\nTake a look at just a small selection of what we carry in our Austin, Tx locations.','Nothing beats the beauty of a natural stone patio.','Natural stone adds amazing depth and color to a backyard patio. At Bedrock Stone & Design we carry patio stone from Oklahoma, Texas, Mexico and Pennsylvania in many different colors and textures. Whether you\'re building a small walkway or a huge backyard entertaining area, the patio stone we carry will move your project from nice to stunning.\r\n\r\nTake a look at just a small selection of what we carry in our Austin, Tx locations.',NULL,'Patio','Patio','Nothing beats the beauty of a natural stone patio.','Nada es mejor que la belleza de un patio de piedra natural.','patio',''),(4,'Masonry Products','masonry_tools',8,NULL,'category/masonry_tools_1460039043.99.jpg','24,0,374,263','The products we carry are well known for their quality. We are proud to distribute Lehigh Cement and Marshalltown tools.','Bedrock Stone & Design carries a full line of products used by masons in the construction industry for the installation of stone.','The products we carry are well known for their quality. We are proud to distribute Lehigh Cement and Marshalltown tools.',NULL,'Masonry Products','Herramienta de Albañilería','Bedrock Stone & Design carries a full line of products used by masons in the construction industry for the installation of stone.','Bedrock Stone & Design está orgulloso de características suministro completo de herramientas de albañilería a muy buenos precios para la comodidad de los albañiles que estamos tan felices de tener como clientes.','masonry_tools','masonry_tools'),(5,'Building Stones','building_stones',3,NULL,'category/building_stones_1488296298.84.jpg','31,20,3062,2294','Retaining walls not only help prevent erosion, but, when built properly, with natural chopped stone from Bedrock Stone & Design, they can be stunning addition to your landscape.  Natural chopped stone also can add a beautiful border to a flower bed that can add texture and contrast to an already beautiful landscape.\r\n\r\nWe offer chopped block in sizes from 2\"x4\" to 12\"x12\" in limestone, Oklahoma Sandstone, Texas Sandstone and others at our yards in Austin, Tx.  Browse some of them here.','For retaining walls or borders, natural chopped block adds color and interest to a landscape design.','Retaining walls not only help prevent erosion, but, when built properly, with natural chopped stone from Bedrock Stone & Design, they can be stunning addition to your landscape.  Natural chopped stone also can add a beautiful border to a flower bed that can add texture and contrast to an already beautiful landscape.\r\n\r\nWe offer chopped block in sizes from 2\"x4\" to 12\"x12\" in limestone, Oklahoma Sandstone, Texas Sandstone and others at our yards in Austin, Tx.  Browse some of them here.','Muros de contención no sólo ayudan a prevenir la erosión, pero , cuando se construyó correctamente, con piedra natural picada de roca de fondo de piedra y diseño, que puede ser impresionante , además de su paisaje. piedra picada natural también puede añadir una frontera hermosa de un macizo de flores que se pueden añadir textura y contraste a una ya hermoso paisaje .\r\n\r\nOfrecemos bloque picado en tamaños de 2 \"x 4 \" a 12 \"x 12 \" en piedra caliza , piedra arenisca de Oklahoma , Texas arenisca y otros en nuestros patios en Austin , Tx . Ver algunos de ellos aquí.','Building Stones','Picada / Seco De','For retaining walls or borders, natural chopped block adds color and interest to a landscape design.','Para muros de contención o fronteras , bloque picada naturales añade color e interés a un diseño del paisaje .','building_stones','chopped_block'),(6,'Landscape Stone','landscape_stone',1,NULL,'category/landscape_stone_1488561067.74.jpg','187,72,800,532','Natural boulders add the next level of visual interest to a landscape.  At Bedrock Stone & Design we carry a wide variety of boulders from areas like Oklahoma, Arkansas, Texas, Pennsylvania in unique shapes, sizes and colors. There is little that adds as much wow factor to a landscape as a well placed natural boulder. \r\n\r\nBrowse just a few samples of the wide variety of boulders we carry at our locations in Austin, Tx.','Natural boulders add depth and interest to your landscape design.','Natural boulders add the next level of visual interest to a landscape.  At Bedrock Stone & Design we carry a wide variety of boulders from areas like Oklahoma, Arkansas, Texas, Pennsylvania in unique shapes, sizes and colors. There is little that adds as much wow factor to a landscape as a well placed natural boulder. \r\n\r\nBrowse just a few samples of the wide variety of boulders we carry at our locations in Austin, Tx.','Piedras naturales se suman al siguiente nivel de interés visual a un paisaje . En Bedrock Stone & Design contamos con una amplia variedad de cantos rodados de las zonas como Oklahoma , Arkansas , Texas , Pennsylvania en formas únicas , tamaños y colores . Es poco lo que se suma la mayor cantidad factor sorpresa a un paisaje como una roca natural bien colocado .\r\n\r\nExplorar sólo algunos ejemplos de la gran variedad de cantos rodados que llevamos en nuestras ubicaciones en Austin , Tx .','Landscape Stone','Cantos Rodados','Natural boulders add depth and interest to your landscape design.','Piedras naturales añaden profundidad e interés a su diseño del paisaje .','landscape_stone','boulders'),(7,'Thin Veneer','thin_veneer',4,2,'category/thin_veneer_1460039594.73.jpg','30,0,270,180','Thin veneer gets you the best of both worlds. You get the character, texture and color of natural rock with a weight that is comparable to many manufactured products. Bedrock Stone & Design is the largest supplier in the Austin, Tx area. \r\n\r\nPlease take a few moments to browse through a small selection of the Thin Veneer products we carry.','Thin Veneer\'s relatively light-weight application broadens your options when considering the best location for this beautiful, easy to use product.','Thin veneer gets you the best of both worlds. You get the character, texture and color of natural rock with a weight that is comparable to many manufactured products. Bedrock Stone & Design is the largest supplier in the Austin, Tx area. \r\n\r\nPlease take a few moments to browse through a small selection of the Thin Veneer products we carry.','Fino barniz que saca lo mejor de ambos mundos . Que obtenga el carácter , la textura y el color de la roca natural con un peso que es comparable al de muchos productos manufacturados. Bedrock Stone & Diseño es el mayor proveedor en el área de Austin , Tx .\r\n\r\nPor favor tome unos momentos para navegar a través de una pequeña selección de los productos de chapa fina que llevamos.','Thin Veneer','Chapa Delgada','Thin Veneer\'s relatively light-weight application broadens your options when considering the best location for this beautiful, easy to use product.','Aplicación relativamente ligero de chapa fina amplía sus opciones cuando se considera la mejor ubicación para este hermoso producto fácil de usar.','thin_veneer','thin_veneer'),(8,'Water Features','water_features',7,NULL,'category/water_features_1487961064.22.jpg','0,45,4545,3456','Bedrock Stone\'s water features are sure to add a splash to any project. Browse though some of them here.','Bedrock Stone features a large selection of high end water features.','Bedrock Stone\'s water features are sure to add a splash to any project. Browse though some of them here.',NULL,'Water Features',NULL,'Bedrock Stone features a large selection of high end water features.',NULL,'water_features',NULL),(9,'Soils & Sands','soils_sands',10,NULL,'category/soils__sands_1488238584.34.jpg','0,26,2546,1936',NULL,'Bedrock Stone carries an assortment of soils and sands for masonry and landscape projects.',NULL,NULL,'Soils & Sands',NULL,'Bedrock Stone carries an assortment of soils and sands for masonry and landscape projects.',NULL,'soils_sands',NULL),(10,'Eldorado','eldorado',5,NULL,'category/eldorado_1488230975.31.jpg','69,14,723,504','For over 40 years, Eldorado Stone has demonstrated an undeniable passion for creating authentic products that not only elevate quality and design, but also attainability. Believability is at the very core of our company philosophy. When you set your eyes on Eldorado Stone, it looks authentic, natural and most of all, beautiful.','Bedrock Stone is proud to partner with Eldorado Stone, the leading manufactured stone provider.','For over 40 years, Eldorado Stone has demonstrated an undeniable passion for creating authentic products that not only elevate quality and design, but also attainability. Believability is at the very core of our company philosophy. When you set your eyes on Eldorado Stone, it looks authentic, natural and most of all, beautiful.',NULL,'Eldorado',NULL,'Bedrock Stone is proud to partner with Eldorado Stone, the leading manufactured stone provider.',NULL,'eldorado',NULL),(11,'Fire & Water Bowls','fire_water',6,NULL,'category/fire__water_bowls_1488238692.22.jpg','0,210,1000,960',NULL,'Bedrock Stone carries a large selection of fire and water bowls to add visual interest to your project.',NULL,NULL,'Fire & Water Bowls',NULL,'Bedrock Stone carries a large selection of fire and water bowls to add visual interest to your project.',NULL,'fire_water',NULL),(12,'Building & Landscape Supplies','supplies',100,NULL,'category/building__landscape_supplies_1488810126.8.jpg','4,3,281,211','Projects ranging from new home construction to landscape hardscape construction are made easier by the availability of products offered by Bedrock stone and design.','Bedrock Stone & Design distributes products used in the construction of indoor and outdoor projects.','Projects ranging from new home construction to landscape hardscape construction are made easier by the availability of products offered by Bedrock stone and design.',NULL,'Building & Landscape Supplies',NULL,'Bedrock Stone & Design distributes products used in the construction of indoor and outdoor projects.',NULL,'supplies',NULL);
