INSERT INTO `web_contentpage` VALUES (1,'Natural Stone','Just about any design product can be made more elegant with the addition of Natural Stone. In an interior design, adding a natural stone wall has the effect of bringing some of the outdoors in, and adds texture and color that is almost impossible to mimic with manufactured materials. Very little adds elegance to a living room like a natural stone fire hearth around a fireplace. \r\n\r\nOutdoors, natural stone borders made of some of Bedrock\'s chopped block can offer a great barrier to weeds and help define an area while adding color and interest. Our boulders can be placed in beds or laws or even added to entertaining areas for informal seating. Aggregates add a weed barrier and help prevent erosion and retain moisture, saving money on water bills.','At Bedrock Stone, we pride ourselves in carrying the largest selection of natural stone products in Central Texas.','natural_stone',1,'contentpage/natural_stone_1488388638.3.jpg','0,0,3456,2592',1,'Just about any design product can be made more elegant with the addition of Natural Stone. In an interior design, adding a natural stone wall has the effect of bringing some of the outdoors in, and adds texture and color that is almost impossible to mimic with manufactured materials. Very little adds elegance to a living room like a natural stone fire hearth around a fireplace. \r\n\r\nOutdoors, natural stone borders made of some of Bedrock\'s chopped block can offer a great barrier to weeds and help define an area while adding color and interest. Our boulders can be placed in beds or laws or even added to entertaining areas for informal seating. Aggregates add a weed barrier and help prevent erosion and retain moisture, saving money on water bills.','Casi cualquier producto de diseño se puede hacer más elegante con la adición de la Piedra Natural . En un diseño de interiores , la adición de un muro de piedra natural tiene el efecto de traer algunos de actividades al aire libre en , y añade textura y color que es casi imposible de imitar con materiales manufacturados. Muy poco añade elegancia a una sala de estar como un hogar de piedra natural de incendios alrededor de una chimenea .\r\n\r\nAl aire libre, las fronteras naturales de piedra hechas de algunos de bloques de roca de fondo picada pueden ofrecer una gran barrera para las malas hierbas y ayudar a definir una zona al tiempo que añade color e interés . Nuestros cantos rodados pueden ser colocados en camas o leyes o incluso añaden a entretener a las zonas de asientos informales . Los agregados añaden una barrera de hierba y ayudan a prevenir la erosión y conservar la humedad , ahorrando dinero en las facturas de agua .','Natural Stone','Piedra Natural','At Bedrock Stone, we pride ourselves in carrying the largest selection of natural stone products in Central Texas.','La piedra natural añade color , profundidad e interés visual a cualquier proyecto. En Bedrock Stone & Design , nos enorgullecemos en la realización de la mayor selección de productos de piedra natural en el centro de Texas .','natural_stone','natural_stone'),(2,'Landscaping','With 4 convenient locations, Bedrock Stone & Design carries the largest supply of landscape supplies in the Austin, TX area. \r\n\r\nWhether you\'re looking for patio stone, boulders, concrete, or aggregates, we\'re sure to have the landscaping supplies you need. Please take a few minutes to browse our site and give us a call at 512-266-8080!','Bedrock Stone & Design is a leading landscaping supplier in the Austin, TX area.','landscaping_supplies',2,'contentpage/landscaping_1488209531.35.jpg','0,0,3456,2592',2,'With 4 convenient locations, Bedrock Stone & Design carries the largest supply of landscape supplies in the Austin, TX area. \r\n\r\nWhether you\'re looking for patio stone, boulders, concrete, or aggregates, we\'re sure to have the landscaping supplies you need. Please take a few minutes to browse our site and give us a call at 512-266-8080!','Con 4 lugares convenientes, Bedrock Stone & Diseño lleva la mayor oferta de fuentes del paisaje en el área de Austin, TX .\r\n\r\nYa sea que esté buscando Patio de piedra , rocas, concreto o agregados, estamos seguros de tener los suministros de jardinería que necesita. Por favo, tome unos minutos para navegar por nuestro sitio y nos dan una llamada al 512-266-8080!','Landscaping','Paisajismo','Bedrock Stone & Design is a leading landscaping supplier in the Austin, TX area.','Lecho de roca de piedra y Diseño es un proveedor líder de jardinería en el área de Austin , TX .','landscaping_supplies','landscaping_supplies'),(3,'Customer Service','No one understands the industry like the staff at Bedrock Stone & Design. Whatever your design need, our representatives have most likely dealt with it before. They can walk you though our many on site displays to show you examples of our product used in real world applications, or help your browse through our on site kiosk systems that show not only our products, but projects in which they\'ve been used.\r\n\r\nCome check us out! You\'ll be glad you did!','At Bedrock Stone & Design, we pride ourself at being the local leader in customer service.','customer_service',500,'contentpage/customer_service_1460036481.46.JPG','0,0,3456,2592',3,'No one understands the industry like the staff at Bedrock Stone & Design. Whatever your design need, our representatives have most likely dealt with it before. They can walk you though our many on site displays to show you examples of our product used in real world applications, or help your browse through our on site kiosk systems that show not only our products, but projects in which they\'ve been used.\r\n\r\nCome check us out! You\'ll be glad you did!','Nadie entiende la industria como el personal de la roca de fondo de piedra y diseño . Sea cual sea su necesidad de diseño , nuestros representantes han tratado más probable que antes. Pueden caminar a pesar de nuestros muchos en el sitio muestra a mostrar ejemplos de nuestro producto utilizados en aplicaciones del mundo real, o ayudar a su navegar a través de nuestro sitio en sistemas de quiosco que muestran no sólo nuestros productos, sino proyectos en los que hemos sido utilizados .\r\n\r\nVen a visitarnos ! Te alegrarás de haberlo hecho!','Customer Service','Servicio al Cliente','At Bedrock Stone & Design, we pride ourself at being the local leader in customer service.','En Bedrock Stone & Design, estamos orgullosos de nosotros mismos a ser el líder local de atención al cliente .','customer_service','customer_service'),(4,'Manufactured Stone','At Bedrock Stone & Design, our manufactured stone\'s colors are unsurpassed in the industry. Each stone and brick is literally hand painted piece-by-piece by highly-trained industry leading artisans. We use only the highest quality natural mineral oxides to infuse the surface with rich, authentic tones. When you take a closer look at Eldorado Stone you will see the unmatched depth and variation of colors; hints of rust, mossy greens, russet browns and golden umbers.\r\n\r\nEvery piece of our manufactured stone is cast from a special mold of an actual natural stone. Craftsmen sort through tons of stone, piece by piece, selecting only the rocks that complement each other and have just the right shape, texture, size and detail. Our state of the art mold manufacturing facility is able to capture every textural detail down to the most finite level.','For the occasion when natural stone just won\'t cut it, Bedrock Stone & Design carries a line of manufactured stones that will be sure to fit your design needs.','manufactured_stone',500,'contentpage/manufactured_stone_1460036704.13.jpg','81,0,634,415',NULL,'At Bedrock Stone & Design, our manufactured stone\'s colors are unsurpassed in the industry. Each stone and brick is literally hand painted piece-by-piece by highly-trained industry leading artisans. We use only the highest quality natural mineral oxides to infuse the surface with rich, authentic tones. When you take a closer look at Eldorado Stone you will see the unmatched depth and variation of colors; hints of rust, mossy greens, russet browns and golden umbers.\r\n\r\nEvery piece of our manufactured stone is cast from a special mold of an actual natural stone. Craftsmen sort through tons of stone, piece by piece, selecting only the rocks that complement each other and have just the right shape, texture, size and detail. Our state of the art mold manufacturing facility is able to capture every textural detail down to the most finite level.','En roca de fondo de piedra y diseño, los colores de nuestra piedra artificial son sin igual en la industria . Cada piedra y ladrillo es, literalmente, pintados a mano pieza por pieza por artesanos líderes en la industria altamente capacitados . Utilizamos sólo los óxidos minerales naturales de la mejor calidad para infundir la superficie con tonos intensos y auténticos . Cuando se echa un vistazo más de cerca a Eldorado Piedra verá la profundidad sin igual y una variación de colores ; toques de óxido, verdes musgo , marrones rojizos y dorados umbers .\r\n\r\nCada pieza de nuestra piedra fabricada se echa de un molde especial de una piedra natural real. Artesanos especie a través de toneladas de piedra , pieza por pieza, seleccionando sólo las rocas que se complementan entre sí y tienen sólo el derecho forma, textura , tamaño y detalle . Nuestro estado de la instalación de arte de fabricación de moldes es capaz de capturar todos los detalles de textura hasta el nivel más finito.','Manufactured Stone','Fabricado Piedra','For the occasion when natural stone just won\'t cut it, Bedrock Stone & Design carries a line of manufactured stones that will be sure to fit your design needs.','Para la ocasión, cuando la piedra natural simplemente no se corte, Bedrock Stone & Design lleva una línea de piedras que serán fabricados seguro para adaptarse a sus necesidades de diseño.','manufactured_stone','manufactured_stone'),(5,'Services','24 hour shipping includes Greater Austin and surrounding cities, San Antonio, Lake Travis, Dripping Springs, Greater Marble Falls, George Town etc. Call to confirm your city. We will usually get it there the same day or within 24 hours!',NULL,'services',500,'contentpage/services_1460036804.53.jpg','14,0,236,167',NULL,'24 hour shipping includes Greater Austin and surrounding cities, San Antonio, Lake Travis, Dripping Springs, Greater Marble Falls, George Town etc. Call to confirm your city. We will usually get it there the same day or within 24 hours!','24 horas de envío incluye metropolitana de Austin y ciudades de los alrededores , San Antonio , el lago Travis , Dripping Springs , Gran Marble Falls, George Town , etc. Llame para confirmar su ciudad. por lo general vamos a llegar allí el mismo día o dentro de las 24 horas !','Services','Servicios',NULL,NULL,'services','services'),(6,'Eldorado Products','Believability is at the very core of our company philosophy. For more than 45 years, Eldorado Stone has been refining the art of architectural stone veneer. When you set your eyes on Eldorado Stone, it looks authentic, natural and–most of all–believable. Take a closer look at Eldorado Stone and you’ll see the difference: unmatched depth and variation of colors, crisp textural details and one of the most extensive selections of stone profiles & colors in the world','Bedrock Stone carries Eldorado products, the industry leader in manufactured stone.','el_dorado',500,'contentpage/eldorado_products_1488209361.5.jpg','179,14,694,401',4,'Believability is at the very core of our company philosophy. For more than 45 years, Eldorado Stone has been refining the art of architectural stone veneer. When you set your eyes on Eldorado Stone, it looks authentic, natural and–most of all–believable. Take a closer look at Eldorado Stone and you’ll see the difference: unmatched depth and variation of colors, crisp textural details and one of the most extensive selections of stone profiles & colors in the world',NULL,'Eldorado Products',NULL,'Bedrock Stone carries Eldorado products, the industry leader in manufactured stone.',NULL,'el_dorado',NULL);
