INSERT INTO `web_location` VALUES (1,'Rock 1','rock_1',1,NULL,'512-266-8080','Austin','3700 HWY 620 N','78734','0,28,225,197','product/no_image.jpeg','At this location, you\'ll find many beautiful displays using our natural stone products. There is a walking path through oak shade trees that features walls made of natural Oklahoma sandstone, landscaping using natural limestone and sandstone boulders and beautiful patios made of Mexican and Oklahoma Sandstone. Taking a tour of this location is sure to give you many ideas for your project. Come visit us today!','Established in 2003, Rock 1 is one of the longest running rock yards in the Austin, TX area.','At this location, you\'ll find many beautiful displays using our natural stone products. There is a walking path through oak shade trees that features walls made of natural Oklahoma sandstone, landscaping using natural limestone and sandstone boulders and beautiful patios made of Mexican and Oklahoma Sandstone. Taking a tour of this location is sure to give you many ideas for your project. Come visit us today!','En este lugar , encontrará muchas hermosas muestras usando nuestros productos de piedra natural . Hay un camino que recorre a través de los árboles de sombra de roble que cuenta con paredes hechas de piedra arenisca natural de Oklahoma , el paisajismo con piedra caliza natural y cantos rodados de arenisca y bellos patios hechos de piedra arenisca de México y Oklahoma . Hacer un recorrido de este lugar es seguro que le dará muchas ideas para su proyecto . Visítenos hoy!','Rock 1','Roca 1','Established in 2003, Rock 1 is one of the longest running rock yards in the Austin, TX area.','Establecido en 2003 , Roca 1 es uno de los astilleros más largos de roca en ejecución en el área de Austin , TX .','rock_1',''),(2,'Rock 2','rock_2',2,NULL,'512-288-0505','Austin','9401 HWY 290 West','78736','0,28,225,197','product/no_image.jpeg','In addition it has a tumbler on site to allow you to select your own stone and have it tumbled, adding character to your design.  It also boasts a large assortment of masonry tools to make your project just a bit easier. Check out our Rock II location, you\'ll be glad you did','Located conveniently on Highway 290 in Austin, TX, Bedrock Stone & Design II has the amazing selection of natural stone products you expect from Bedrock Stone & Design.','In addition it has a tumbler on site to allow you to select your own stone and have it tumbled, adding character to your design.  It also boasts a large assortment of masonry tools to make your project just a bit easier. Check out our Rock II location, you\'ll be glad you did','Además dispone de un vaso en el sitio que le permite seleccionar su propia piedra y hacer que se desplomó , añadiendo carácter a su diseño. Además, cuenta con una gran variedad de herramientas de albañilería para hacer su proyecto un poco más fácil. Visita nuestra ubicación Roca II , se le alegra que usted lo hizo','Rock 2','Roca 2','Located conveniently on Highway 290 in Austin, TX, Bedrock Stone & Design II has the amazing selection of natural stone products you expect from Bedrock Stone & Design.','Situado convenientemente en la autopista 290 en Austin , TX , Bedrock Stone & Design II tiene la increíble selección de productos de piedra natural se pueden esperar de Bedrock Stone & Design.','rock_2',''),(3,'Rock 3','rock_3',3,NULL,'512-263-2288','Bee Cave','13652 Hwy 71 West','78738','0,28,225,197','product/no_image.jpeg','Located conveniently on 71 in Bee Caves, Texas, Bedrock Stone and Design III has a huge selection of natural patio stone and natural chopped stone as well as a large selection of aggregate products. If you\'re in the Spicewood, Texas are or Lakeway area, this location is convenient for you and offers the product line you\'ve come to expect from Bedrock Stone & Design.','Bedrock Stone & Design III is our Highway 71 location.','Located conveniently on 71 in Bee Caves, Texas, Bedrock Stone and Design III has a huge selection of natural patio stone and natural chopped stone as well as a large selection of aggregate products. If you\'re in the Spicewood, Texas are or Lakeway area, this location is convenient for you and offers the product line you\'ve come to expect from Bedrock Stone & Design.','Ubicado convenientemente en 71 en Bee Cuevas , Texas, Bedrock Stone y Diseño III tiene una gran selección de patio de piedra natural y piedra natural picada , así como una gran selección de productos agregados . Si estás en la Spicewood , Texas son o área Lakeway , esta ubicación es conveniente para usted y ofrece la línea de productos que ha llegado a esperar de Bedrock Stone & Design.','Rock 3','Roca 3','Bedrock Stone & Design III is our Highway 71 location.','Lecho de roca de piedra y Diseño III es nuestra ubicación autopista 71 .','rock_3','rock_3'),(4,'Rock 4','rock_4',4,NULL,'512-266-4500','Austin','2209 HWY 620 N','78734','0,28,225,197','product/no_image.jpeg','Our Rock IV location in Austin, Tex features the same line of natural stone products you\'ve come to expect from Bedrock Stone & Design but also a line of specialty stone products that are sure to liven up your project. Come check us out!','Bedrock Stone & Design IV is our newest location in Austin, TX.','Our Rock IV location in Austin, Tex features the same line of natural stone products you\'ve come to expect from Bedrock Stone & Design but also a line of specialty stone products that are sure to liven up your project. Come check us out!','Nuestra ubicación de la roca IV en Austin , Tex cuenta con la misma línea de productos de piedra natural que ha llegado a esperar de roca de fondo de piedra y diseño sino también una línea de productos de piedra de la especialidad que son seguros para darle vida a su proyecto. Ven a visitarnos!','Rock 4','Roca 4','Bedrock Stone & Design IV is our newest location in Austin, TX.','Lecho de roca de piedra y Diseño IV es nuestra nueva ubicación en Austin , TX .','rock_4','rock_4');
